package report.btrace.read;

import cn.tellwhy.report.btrace.read.ByteCode;
import cn.tellwhy.report.btrace.read.Opcodes;
import cn.tellwhy.util.type.BeanUtil;

import java.util.LinkedList;
import java.util.Map;
import java.util.Queue;
import java.util.Stack;

/**
 * Created by aaa on 18-2-1.
 */
public enum ReaderCode {
    Instance;
    Map<Integer, String> pairs;
    
    ReaderCode() {
        pairs = BeanUtil.get(new Opcodes());
    }
    
    public String get(int code){
        return pairs.get(code);
    }
    
    static String txt = "";
    public static void main(String[] args){
//        OptionCode optionCode = new OptionCode();
//        OpCode optionCode = new OpCode();
        ByteCode optionCode = new ByteCode();
        Map<Integer, String> pairs = BeanUtil.get(optionCode);
        String waitTxt = txt.replace(" ", "");
        String next = "";
        int index = 0;
        Queue<String> queue = new LinkedList<>();
        while (index < waitTxt.length()){
            next = waitTxt.substring(index, index + 2);
            index += 2;
            int value = Integer.parseInt(next, 16);
            
            String code = pairs.get(value);
            if (code == null){
                queue.add(String.valueOf(value));
            } else {
                if (queue.isEmpty()){
                    queue.add(code);
                } else {
                    queue.forEach(s -> System.out.print(s + " "));
                    queue = new LinkedList<>();
                    System.out.println();
                }
            }
        }
    }
}
